const config      = require('../config.json');
const { User }    = require('./db');

const PDFDocument = require('pdfkit');
const bwipjs      = require('bwip-js');
const transporter = require('nodemailer').createTransport(config.mail);

const shirt = {
    'none': 'Non',
    'fxs' : 'Femme - XS',
    'fs'  : 'Femme - S',
    'fm'  : 'Femme - M',
    'fl'  : 'Femme - L',
    'fxl' : 'Femme - XL',
    'mxs' : 'Homme - XS',
    'fs'  : 'Homme - S',
    'fm'  : 'Homme - M',
    'fl'  : 'Homme - L',
    'fxl' : 'Homme - XL'
};

const logo = 'data:image/jpeg;base64,';

function getRandom (length) {
    return Math.floor(Math.pow(10, length-1) + Math.random() * 9 * Math.pow(10, length-1));
}

module.exports = function (user) {
    const generateCode = function () {
        user.barcode = getRandom(12).toString();
        return user.save();
    };

    const generateBarcode = function () {
        return new Promise((resolve, reject) => {
            bwipjs.toBuffer({
                bcid       : 'ean13',
                text       : user.barcode,
                height     : 10,
                includetext: false
            }, function (err, png) {
                if (err) {
                    reject(err);
                }

                resolve(png);
            });
        });
    };
    const generatePDF = function (barcode) {
        return new Promise((resolve, reject) => {
            const doc = new PDFDocument();

            doc.image(logo, (doc.page.width - 350) / 2, 30, { width: 350, height: 350 });

            doc
                .fontSize(20)
                .text(`Nom: ${user.name}`, 20, 400)
                .text(`T-Shirt: ${shirt[user.shirt]}`, 20, 420)
                .text(`Accompagn: ${user.plusone ? 'Oui' : 'Non'}`, 20, 440);

            doc.image(barcode, 215, 500);

            const buffers = [];

            doc.on('data', chunk => buffers.push(chunk));

            doc.on('end', () => {
                resolve(Buffer.concat(buffers));
            });

            doc.end();
        });
    };

    return generateCode()
        .then(() => generateBarcode())
        .then(barcode => generatePDF(barcode))
        .then(pdfBuffer => transporter.sendMail({
            from: '"UTT Arena" <arena@utt.fr>',
            to: user.email,
            subject: 'Place UTT Arena',
            text: 'Bonjour  toi,\nTu trouveras en pice jointe ta place pour l\'UTT Arena. Imprime l avant de venir !\n\nCordialement,\nL\'quipe de l\'UTT Arena',
            attachments: [
                { filename: 'uttarena.pdf', content: pdfBuffer }
            ]
        }))
        .catch(err => {
            console.log('ERR', err);
        });
};
